import './App.scss';
import Header from './Header/Header.jsx';
import Section from './Section/Section';
import Aside from './Aside/Aside';
import Aside_Profile from './Aside_Profile/Aside_Profile';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Aside_News from './Aside_News/Aside_News';
import Aside_Music from './Aside_Music/Aside_Music';
import Aside_Friends from './Aside_Friends/Aside_Friends';

const App=(props)=> {
  return (
    <BrowserRouter>
    <div className="App">
    <Header></Header>
    <Section></Section>
    <Switch>
    <Route path='/aside' render={()=><Aside state={props.state.MessagesPage}></Aside>}></Route>
    <Route path='/profile' component={Aside_Profile}></Route>
    <Route path="/music" component={Aside_Music}></Route>
    <Route path="/friends" component={Aside_Friends}></Route>
    <Route path="/" component={Aside_News}></Route>
    </Switch>
 </div>
 </BrowserRouter>
  );
}

export default App;
